import { useState } from "react";
import React from "react";

function App() {
   const mockTodos = [
      { id: "1", title: "Needed text", completed: "true" },
      { id: "2", title: "Needed ", completed: "true" },
      { id: "3", title: "Text ", completed: "true" },
   ];
   const [todo, setTodosList] = useState(mockTodos);
   setTodosList(mockTodos);
   return (
      <div>
         {todo.map((todo) => {
            <p key={todo.id}>{todo.title}</p>;
         })}
      </div>
   );
}

export default App;
